        /* Navbar */

            font-weight: 700;
            color: #00d4ff;
            text-decoration: none;
        }
        .navbar-links {

            display: flex;
            gap: 20px;
            margin: 0; 
            padding: 0;
        }
        .navbar-links a {

            text-decoration: none;
            font-weight: 500;
            transition: color 0.2s ease;

        .navbar-links a:hover,

                padding: 15px;
                position: static;

                gap: 0.5em 1em;
            }

            margin-bottom: 3em;

        }

            color: #00d4ff;
        }
        .major-header p {
            font-size: 1.15em;
            max-width: 600px;
            margin-left: auto;
            margin-right: auto;
            color: #a8a8a8;
        }
        /* (สไตล์หน้า Poster) */
        .poster-wrapper {
            max-width: 800px;
            margin: 1em auto;
            border: 1px solid rgba(71, 85, 105, 0.5);

        .poster-wrapper img {
            border-radius: 0;
            width: 100%;
